import React from "react";
import { Routes, Route } from "react-router-dom";

import Contact from "./Contact";
 import About from "./About";
import Ticket from "./Ticket";
import Home from "./Home";
import City from "./City";
import Booking from "./Booking";
import Success from "./Sucess";
import Feedback from "./Feedback";
import Nav from "./Nav";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Contact />}></Route>
        <Route path="/city" element={<City />}></Route>
        <Route path="/about" element={<About />}></Route>
        <Route path="/:cityname" element={<Nav />}>
          <Route path="home" element={<Home />}></Route>

          <Route path="home/:userId" element={<Ticket />}></Route>
          <Route path="home/:movie/:movie" element={<Booking />}></Route>
          <Route path="home/:movie/:movie/payment" element={<></>}></Route>
          <Route path="home/:movie/:movie/payment/success" element={<Success />}>
            <Route path="feedback" element={<Feedback />}></Route>
          </Route>
        </Route>
      </Routes>
    </>
  );
}

export default App;
